import  hotel from "../data/hotel"

const ListeHotel = () => {
  return (
    <div>
        <h2 className="mb-4">Liste des Hotel</h2>

        <div className="row">
          {hotel.map((hotel) => (
            <div className="col-md-3 mb-4" key={hotel.id}>
              <div className="card h"></div>

            </div>
          ))}

        </div>

    </div>
  )
}

export default ListeHotel
